--Specifying use case
use cs3380;

--Cleaning up previous tables;
DROP TABLE IF EXISTS viewed;
DROP TABLE IF EXISTS orders;
DROP TABLE IF EXISTS people;
DROP TABLE IF EXISTS orderLineItems;
DROP TABLE IF EXISTS products;
DROP TABLE IF EXISTS provinces;

--Cleaning up current tables;
DROP TABLE IF EXISTS Roster;
DROP TABLE IF EXISTS Bosses;
DROP TABLE IF EXISTS Effect;
DROP TABLE IF EXISTS Has_type;
DROP TABLE IF EXISTS Has_ability;
DROP TABLE IF EXISTS Pokemon;
DROP TABLE IF EXISTS Moves;
DROP TABLE IF EXISTS Trainers;
DROP TABLE IF EXISTS Abilities;
DROP TABLE IF EXISTS Types;
DROP TABLE IF EXISTS Games;

--Creating new tables
CREATE TABLE Games (game_name VARCHAR(100) NOT NULL, release_year INT NOT NULL, PRIMARY KEY (game_name));
CREATE TABLE Types (type_name VARCHAR(100) NOT NULL, PRIMARY KEY (type_name));
CREATE TABLE Abilities (ability_name VARCHAR(100) NOT NULL, description VARCHAR(200), orig_gen INT NOT NULL, PRIMARY KEY (ability_name));
CREATE TABLE Trainers (trainer_name VARCHAR(100) NOT NULL, PRIMARY KEY (trainer_name));
CREATE TABLE Moves (move_name VARCHAR(100) NOT NULL, move_type VARCHAR(100) NOT NULL REFERENCES Types(type_name), move_power INT NOT NULL, move_acc INT NOT NULL, move_pp INT NOT NULL, orig_gen INT NOT NULL, PRIMARY KEY (move_name));
CREATE TABLE Pokemon (nat_id INT NOT NULL, pok_name VARCHAR(100) NOT NULL, orig_game VARCHAR(100) NOT NULL REFERENCES Games(game_name), evolves_from INT REFERENCES Pokemon(nat_id), hp INT NOT NULL, attack INT NOT NULL, defense INT NOT NULL, PRIMARY KEY (nat_id));
CREATE TABLE Has_ability (nat_id INT NOT NULL REFERENCES Pokemon(nat_id), ability_name VARCHAR(100) NOT NULL, ability_type VARCHAR(100) NOT NULL, PRIMARY KEY (nat_id, ability_name));
CREATE TABLE Has_Type (nat_id INT NOT NULL REFERENCES Pokemon(nat_id), type_name VARCHAR(100) NOT NULL REFERENCES Types(type_name), PRIMARY KEY (nat_id, type_name));
CREATE TABLE Effect (affecting_type VARCHAR(100) NOT NULL REFERENCES Types(type_name), affected_type VARCHAR(100) NOT NULL REFERENCES Types(type_name), effect_level INT NOT NULL, PRIMARY KEY (affecting_type, affected_type));
CREATE TABLE Bosses (boss_name VARCHAR(100) NOT NULL REFERENCES Trainers(trainer_name), boss_game VARCHAR(100) NOT NULL REFERENCES Games(game_name), PRIMARY KEY (boss_name, boss_game));
CREATE TABLE Roster (roster_entry_id INT IDENTITY(1,1) PRIMARY KEY, trainer_name VARCHAR(100) NOT NULL REFERENCES Trainers(trainer_name), nat_id INT NOT NULL REFERENCES Pokemon(nat_id), game_name VARCHAR(100) NOT NULL REFERENCES Games(game_name));

